name = "Gasoline_Surrogate"
shortDesc = u"/scratch/westgroup/Importer/RMG-models/Gasoline_Surrogate/therm.dat"
longDesc = u"""
Gasoline Surrogate

A detailed chemical kinetic mechanism for the simulation of gasoline surrogate 
mixtures has been assembled from existing LLNL mechanisms for n-heptane, 
iso-octane [1], toluene and C5-C6 olefins [2] and validated using experimental 
data from shock tubes, stirred reactor, and rapid compression machines [3]. 
The detailed kinetic model has been used to estimate a surrogate composition 
targeting a RD387 gasoline (LLNL surrogate) and the obtained formulation was 
used in comparisons with gasoline experimental flame speeds available in 
literature [4]. The same surrogate composition coupled with the detailed mechanism 
here available was successfully applied to the simulation of an HCCI engine 
under naturally aspirated and boosted conditions [5]. A reduced version of 
the kinetic mechanism is also available for engine numerical applications [4]. 
Modeling results obtained from this mechanism were also compared with LLNL 
surrogate and RD387 rapid compression machine data across a wide range of 
temperature pressure and equivalence ratios [6-7]. The mechanism performs 
well at both low and high temperatures and over a broad pressure range important 
for internal combustion engines.


Mehl M., W.J. Pitz, C.K. Westbrook, H.J. Curran, "Kinetic modeling of gasoline surrogate components 
and mixtures under engine conditions", Proceedings of the Combustion Institute 33:193-200 (2011).

Downloaded from https://www-pls.llnl.gov/?url=science_and_technology-chemistry-combustion-gasoline_surrogate in September 2013

Abstract
=====================
Real fuels are complex mixtures of thousands of hydrocarbon compounds including 
linear and branched paraffins, naphthenes, olefins and aromatics. It is generally 
agreed that their behavior can be effectively reproduced by simpler fuel surrogates 
containing a limited number of components.

In this work, an improved version of the kinetic model by the authors is used to 
analyze the combustion behavior of several components relevant to gasoline surrogate 
formulation. Particular attention is devoted to linear and branched saturated 
hydrocarbons (PRF mixtures), olefins (1-hexene) and aromatics (toluene). Model 
predictions for pure components, binary mixtures and multi-component gasoline 
surrogates are compared with recent experimental information collected in rapid 
compression machine, shock tube and jet stirred reactors covering a wide range of 
conditions pertinent to internal combustion engines (3?50 atm, 650?1200 K, stoichiometric 
fuel/air mixtures). Simulation results are discussed focusing attention on the 
mixing effects of the fuel components.
"""
